const addNote = () => {
    return (
        <div className='Note new'>
        <textarea 
        rows='8'
        cols = '10'
        placeholde= 'Type to add a note....' />
        <div className="note-footer">
        <small className="" >200 Remaining</small>
        <button class="btn-save">Save</button>
        </div>
    </div>
    );
};

export default addNote;
